import FormInput from '../FormInput/formInput.component';


const ReviewForm = () => {
    return (
        <form onSubmit={handleSubmit}>
            <FormInput 
            name='text'
            type='text'
            handleChange={handleChange}
            value={text}
            label='Email'
            required
            />       
                        
            <FormInput 
            name='name'
            type='name'
            handleChange={handleChange}
            value={name}
            label='Email'
            required
            />
            <FormInput 
            name='email'
            type='email'
            label='email'
            value={email}
            handleChange={handleChange}
            required                   
            />
            <div className='buttons'>
                <button className='review-button' type='submit'>
                    Leave a review
                </button>
            </div>
        </form>
    )
}


export default ReviewForm;
